import React from 'react'
import {Redirect, useHistory} from "react-router-dom";
const MyList = () => {
    let history=useHistory();
    const token=localStorage.getItem("token")
    if(token==null)
    {
        alert("")
        history.push({
            pathname:'/account-login'
        })
    }
    return (
        <div className="mylist">
            <h1>MY LIST</h1>
        </div>
    )
}

export default MyList
